import React, {useState} from "react";

const Tiles = () => {
    return (
        <div id="tilesWrapper">
            <div id="tileContainer">
            <div className="imgWrapper"><img src={require("../imgs/giyu.png")} alt="giyu.png" /><div className="picName">Giyu</div></div>
            <div className="imgWrapper"><img src={require("../imgs/gyomei.png")} alt="gyomei.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/kanao.png")} alt="kanao.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/mitsuri.png")} alt="mitsuri.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/muichiro.png")} alt="muichiro.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/obanai.png")} alt="obanai.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/sakonji.png")} alt="sakonji.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/sanemi.png")} alt="sanemi.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/shinobu.png")} alt="shinobu.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/tanjiro.png")} alt="tanjiro.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/tengen.png")} alt="tengen.png" /></div>
            <div className="imgWrapper"><img src={require("../imgs/zenitsu.png")} alt="zenitsu.png" /></div>



            </div>
        </div>
    )
};

export default Tiles;
